.logo-bar {
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 42px 68px;
    gap: 68px;
    width: 1280px;
    height: 130.83px;
    background-color: #FFFFFF;
    opacity: 1;
}

.logo {
    display: flex;
    justify-content: center;
    align-items: center;
    width: auto;
    height: auto;
    padding: 0px;
}

.logo img {
    width: 116.07px;
    height: 38.21px;
    object-fit: contain;
}
